class TodoApp extends Component {
  render() {
    return (
      <div className="TodoApp">
        <LoginComponent />
      </div>
    );
  }
}

class LoginComponent extends Component {
  render() {
    return (
      // in JSX you cannot return mutiple elements back
      <div>
        Login Name:
        <input type="text" name="username" defaultValue="jiayue" />
        Password: <input type="password" name="password" />
        <button>Login</button>
      </div>
    );
  }
}
export default TodoApp;
